import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      {<CryptoTable />}
    </div>
  );
}
export default App;



function CryptoTable() {

  const [data, setData] = useState("");
  var res = "";
  console.log(data)

  async function fetchData() {
    res = await fetch("http://localhost:8080/ExcerciseThursday/api/crypto");
    res.json().then(res => setData(res));
    console.log(data);
  }

  useEffect(() => {
    fetchData()
  }, []);

  return (
    <div>{<TableMap data={data} />}</div>
  )
}



function TableMap(props) {

  var arri = [];

  for (const [key, value] of Object.entries(props.data)) {
    const arrj = {key,value};
    arri.push(arrj);
  }

  console.log(arri);


  return (
    <table>
      <thead>
        <tr>
          <th>Symbol</th>
          <th>Value</th>
        </tr>
      </thead>
      <tbody>
        <Table arr={arri}/>
      </tbody>
    </table>
  )
}

function Table({ arr }) {
  const tableItems = arr.map((n) => <TableItem key={n.key} value={n.value} />);
  return tableItems;
}

function TableItem(props) {
  return <tr><th>{props.key}</th><th>{props.value}</th></tr>
}
